import React from "react";
import {Typography} from "@material-ui/core";
const About = props =>{
    return(
        <div id="about">
            <section id="title">About Me</section>
            <section id="desc">
                {/* <i></i> */}
                <Typography component="p">
                    Hello, my name is Shawn and I'm a Software Engineer 
                    based in Sarnia, Ontario.
                    <br/>
                    I enjoy learning new frameworks, libraries and languages
                    to be able to create a wide variety of content. I also enjoy 
                    practicing coding challenges on Leetcode in order to continue 
                    testing my problem solving skills.
                    <br/>
                </Typography>
            </section>
        </div>
    );
}
export default About;
